import React from "react";

import SplashLogo from "../assets/gitconvex.png";

export default function SplashScreen() {
  return (
    <>
      <div className="splash-logo block p-3 mx-auto my-auto shadow-md">
        <img
          src={{ SplashLogo }}
          style={{
            backgroundOrigin: "center",
            backgroundSize: "100% 100%"
          }}
        ></img>
      </div>
    </>
  );
}
